import React, { useEffect, useState } from 'react';

function DVManagerView() {
  const [data, setData] = useState([]);
  useEffect(() => {
    fetch('/api/dv-data')
      .then(res => res.json())
      .then(setData);
  }, []);
  return (
    <div style={{ padding: 24 }}>
      <h2>DV Manager View</h2>
      <p>Summary and analytics for managers (customize as needed)</p>
      <table border={1} cellPadding={6} cellSpacing={0}>
        <thead>
          <tr>
            <th>Module</th>
            <th>TB Dev Total</th>
            <th>Test Pass</th>
            <th>Code Coverage (%)</th>
            <th>Block Status</th>
          </tr>
        </thead>
        <tbody>
          {data.map((row, idx) => (
            <tr key={row.id || idx}>
              <td>{row.module}</td>
              <td>{row.tb_dev_total}</td>
              <td>{row.test_pass}</td>
              <td>{row.code_coverage_percent}</td>
              <td>{row.block_status}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
export default DVManagerView;
